import React, { useMemo, useState, useEffect } from 'react';
import ReactFlow, { 
  Background, 
  Controls, 
  MiniMap,
  useNodesState,
  useEdgesState,
  MarkerType,
  Handle
} from 'reactflow';
import 'reactflow/dist/style.css';
import { motion } from 'framer-motion';
import { getCachedServiceIcon } from '../services/IconResolver';

// Move AWSServiceNode outside and memoize it
const AWSServiceNode = React.memo(({ data }) => (
  <motion.div
    className={`aws-service-node ${data.isMissing ? 'missing' : ''}`}
    initial={{ scale: 0, opacity: 0 }}
    animate={{ scale: 1, opacity: 1 }}
    exit={{ scale: 0, opacity: 0 }}
    whileHover={{ scale: 1.1 }}
    transition={{ type: "spring", stiffness: 300 }}
  >
    <Handle 
      type="target" 
      position="top" 
      id={`${data.id}-target`}
      className="handle"
    />
    <div className="node-content">
      {data.isMissing ? (
        <div className="missing-service-placeholder">
          <span>?</span>
        </div>
      ) : (
        <img src={data.icon} alt={data.label} className="service-icon" />
      )}
      <span className="service-label">{data.label}</span>
    </div>
    <Handle 
      type="source" 
      position="bottom" 
      id={`${data.id}-source`}
      className="handle"
    />
  </motion.div>
));

// Move nodeTypes outside component
const nodeTypes = {
  awsService: AWSServiceNode
};

const createNodeId = (serviceName) => {
  if (typeof serviceName !== 'string') {
    console.error('Invalid service name:', serviceName);
    return 'invalid-service';
  }
  return serviceName.toLowerCase().replace(/\s+/g, '-');
};

const AWSArchitectureDisplay = ({ architecture, currentQuestion }) => {
  const [nodes, setNodes] = useState([]);
  const [edges, setEdges] = useState([]);

  useEffect(() => {
    if (!architecture) return;

    const newNodes = [];
    const newEdges = [];
    const nodePositions = {};
    let xPosition = 0;

    // First, create all nodes
    architecture.services.forEach((service, index) => {
      const nodeId = service.id || service.name.toLowerCase().replace(/[^a-z0-9]+/g, '-');
      const node = {
        id: nodeId,
        type: 'awsService',
        position: { x: xPosition, y: 100 },
        data: {
          label: service.name,
          icon: service.icon,
          isMissing: service.name.toLowerCase().includes('missing')
        }
      };
      newNodes.push(node);
      nodePositions[nodeId] = node.position;
      xPosition += 150; // Increment x position for next node
    });

    // Then create all edges from the connections
    if (architecture.connections) {
      architecture.connections.forEach((conn) => {
        const fromId = typeof conn.from === 'string' ? 
          conn.from.toLowerCase().replace(/[^a-z0-9]+/g, '-') : 
          conn.from.id;
        const toId = typeof conn.to === 'string' ? 
          conn.to.toLowerCase().replace(/[^a-z0-9]+/g, '-') : 
          conn.to.id;

        // Only create edge if both nodes exist
        if (nodePositions[fromId] && nodePositions[toId]) {
          newEdges.push({
            id: `${fromId}-${toId}`,
            source: fromId,
            target: toId,
            type: 'smoothstep',
            animated: true,
            style: { stroke: '#4FD1C5', strokeWidth: 2 },
            markerEnd: { type: MarkerType.ArrowClosed }
          });
        } else {
          console.warn(`Cannot create edge: ${fromId} -> ${toId}, one or both nodes missing`);
        }
      });
    }

    console.log('Nodes:', newNodes);
    console.log('Edges:', newEdges);
    console.log('Connections:', architecture.connections);

    setNodes(newNodes);
    setEdges(newEdges);
  }, [architecture]);

  return (
    <div style={{ height: '400px', width: '100%' }}>
      <ReactFlow
        nodes={nodes}
        edges={edges}
        nodeTypes={nodeTypes}
        fitView
        attributionPosition="bottom-left"
      >
        <Background />
        <Controls />
      </ReactFlow>
    </div>
  );
};

export default AWSArchitectureDisplay;
